import React from "react";
import Layout from './Layout';
import { BrowserRouter, Route } from "react-router-dom";


const App = () => {
    return ( 
        <BrowserRouter>
            <Route exact path='path' component={component}>
                <Layout />
            </Route>
            
        </BrowserRouter>
        
     );
}
 
export default App;
